import React, {useState} from 'react';
import Word from './Word';
import './App.css';

function App() {

  const words = ['IT', 'IS', 'TEN', 'TWENTY', 'FIVE', 'QUARTER', 'HALF', 'PAST', 'TO', 'ONE', 'TWO', 'THREE',
                 'FOUR', 'FIVE', 'SIX', 'SEVEN', 'EIGHT', 'NINE', 'TEN', 'ELEVEN', 'TWELVE', 'O\'CLOCK'];

  return (
    <div className="App">
      <div>
        <h3>WORD CLOCK</h3>
      </div>
      <hr/>
      <div className="flex-container">
        {words.map(word => (
          <Word text={word}/>
        ))}
      </div>
    </div>
  );
}

export default App;
